import React from 'react';
import Dashboard from '../components/Dashboard/Dashboard';
import Sidebar from '../components/Navigation/Sidebar';

const Home: React.FC = () => {
    return (
        <div className="home-container">
            <Sidebar />
            <main>
                <h1>Health Dashboard</h1>
                <Dashboard />
            </main>
        </div>
    );
};

export default Home;
